/*
 * Border layout (contains component in a border)
 */

const layoutStyle = {
	margin: 20,
	padding: 20,
	border: '1px solid #DDD'
};

const Layout = props => (
	<div style={layoutStyle}>
	{props.children}
	</div>
);

export default Layout;
